      config[seriesKey] = { label: `${dimensionLabelText} · ${category} · ${METRIC_LABELS[metricKey] ?? metricKey}`, color }
      seriesKeys.push(seriesKey)
    })
  })

  return { data: basePoints, categories, config, seriesKeys }
}

